import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

import "./CSS/auth.css";

function Auth(){

    return(
        <div>
        <div className="wrapper fadeInDown">
          <div id="formContent">
            <div className="fadeIn first">ADMIN LOGIN</div>

            <form>
              <input
                type="text"
                className="loginInput fadeIn second"
                name="email"
                placeholder="Email"
              />
              <input
                type="password"
                className="loginInput fadeIn third"
                name="password"
                placeholder="Password"
              />
              <button variant="contained" color="primary" className="btn fadeIn fourth">Confirm</button>
            </form>
          </div>
        </div>
        </div>
    )
};
export default Auth;
